import React from 'react';
import Header from '../pageElements/Header';

export default function Feed() {
    let links = ["Home", "Confess/Share", "Inbox"];

  return (
      <div className="container-fluid">
          <div className="row">
              <Header links={links}/>
              <div className="container py-4">
                  <div className="row">
                      feed page
                  </div>
              </div>
          </div>
      </div>
  );
}
